            F=N,
            M=G,
            O=C,
            P=E
        ;   D==(+),
            is_ground(G, A) ->
            copy_with_variable_replacement(A, Q, F),
            H=[B=Q|L],
            F=N,
            M=G,
            O=C,
            P=E
        ;   A=..[_|R],
